    font-size: 13px;
  }

    padding: 16px;

    flex-direction: column;
    background: #161b22;
    border-radius: 8px;

  .side.feature .side-header {

    color: #3fb950;
    border-bottom-color: #244d24;
  }
  .side img {
    width: 100%;
    height: auto;
    display: block;
  }
  .no-image {
    display: flex;
    align-items: center;
    justify-content: center;
    min-height: 400px;
    color: #484f58;
    font-style: italic;
  }
  .keyboard-hint {
    position: fixed;
    bottom: 16px;
    right: 16px;
    background: #21262d;
    border: 1px solid #30363d;
    border-radius: 6px;
    padding: 8px 14px;
    font-size: 12px;
    color: #8b949e;
  }
  kbd {
    background: #30363d;
    border: 1px solid #484f58;
    border-radius: 3px;
    padding: 1px 6px;
    font-family: monospace;
    font-size: 11px;
  }

let current = 0;

function render() {
  const s = slides[current];
  document.getElementById('pageTitle').textContent = s.name;
  document.getElementById('counter').textContent = 'Page ' + (current + 1) + ' / ' + slides.length;

  document.getElementById('masterImg').innerHTML = s.masterB64
    ? '<img src="data:image/png;base64,' + s.masterB64 + '" alt="master - ' + s.name + '">'
    : '<div class="no-image">No screenshot (page may not exist on this branch)</div>';

  document.getElementById('featureImg').innerHTML = s.featureB64
    ? '<img src="data:image/png;base64,' + s.featureB64 + '" alt="feature - ' + s.name + '">'
    : '<div class="no-image">No screenshot (page may not exist on this branch)</div>';

  document.getElementById('prevBtn').disabled = current === 0;
  document.getElementById('nextBtn').disabled = current === slides.length - 1;
}

function prev() { if (current > 0) { current--; render(); window.scrollTo(0, 0); } }
function next() { if (current < slides.length - 1) { current++; render(); window.scrollTo(0, 0); } }

document.addEventListener('keydown', (e) => {
  if (e.key === 'ArrowLeft') prev();
  if (e.key === 'ArrowRight') next();
});

render();
</script>
